import React from "react";
import Navbar from "./components/Navbar";
import FilterBar from "./components/FilterBar";
import RestaurantCard from "./components/RestaurantCard";
import "./App.css";

const restaurants = [
  {
    id: 1,
    name: "CHILLOX",
    logo: "https://protoinfrastack.ivondy.com/media/3EBwCh5bn1Ukdqedr4Y75Hsp7Wb4ae9qYMYJ", // replace with actual logo url
  },
  {
    id: 2,
    name: "BFC",
    logo: "https://protoinfrastack.ivondy.com/media/otfVG8bl1QYvM8DEXsP1cQi3mE7Qpe5GStMq",
  },
  {
    id: 3,
    name: "BREW BUDDIES",
    logo: "https://via.placeholder.com/150/004d40/ffffff?text=Brew+Buddies", // placeholder
  },
  {
    id: 4,
    name: "BURGER POINT",
    logo: "https://via.placeholder.com/150/ffc107/000000?text=Burger+Point", // placeholder
  },
];

function App() {
  return (
    <div className="app-container">
      <Navbar />
      <main>
        <h2>RESTAURANT LISTING</h2>
        <FilterBar />
        <div className="restaurant-list">
          {restaurants.map((r) => (
            <RestaurantCard key={r.id} restaurant={r} />
          ))}
        </div>
        <div className="pagination">pages</div>
      </main>
    </div>
  );
}

export default App;
